    input [15:0] A,
    input [7:0] B,
    output reg [15:0] result,
    output reg [15:0] odd
);

reg [15:0] a_reg;
reg [7:0] b_reg;

always @(A or B) begin
    a_reg <= A;
    b_reg <= B;
end

always @(*) begin
    if (b_reg == 0)
        result = 0;
    else
        {result, odd} = div_16bit_logic(a_reg, b_reg);
end

function [31:0] div_16bit_logic;
    input [15:0] dividend;
    input [7:0] divisor;
    reg [15:0] quotient;
    reg [15:0] remainder;
    integer i;

    quotient = 0;
    remainder = dividend;

    for (i = 15; i >= 0; i--) begin
        remainder = {remainder[14:0], 1'b0};
        if (remainder >= divisor) begin
            remainder = remainder - divisor;
            quotient[i] = 1;
        end
    end

    div_16bit_logic = {quotient, remainder};
endfunction

endmodule

module div_16bit (
    input [15:0] A,
    input [7:0]  B,
    output reg [15:0] result,
    output reg [15:0] odd
);

reg [15:0] a_reg;
reg [7:0] b_reg;

always @(*) begin
    a_reg = A;
    b_reg = B;
end

always @(*) begin
    if (b_reg == 0) begin
        result = 16'b0;
        odd = A;
    end else begin
        reg [15:0] quotient = 16'b0;
        reg [15:0] remainder = a_reg;
        reg [3:0] shift_count = 4'd0;

        while (remainder >= b_reg) begin
            remainder = remainder - b_reg;
            quotient[shift_count] = 1'b1;
            shift_count = shift_count + 1'd1;
        end

        result = quotient;
        odd = remainder;
    end
end

endmodule

